    false,nt"url": null,nt"notes": "This annual narrative report for Port Louisa
    National Wildlife Refuge outlines Refuge accomplishments during the 1969 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water quality, and food and cover during the year. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, raptors, fish, reptiles,
    and disease- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, collections and receipts, and vegetation control.
    Resource management is outlined; topics include fur harvesting, timber harvesting,
    and commercial fishing. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, Refuge visitors, Refuge participation, hunting, violations, and safety. Items
    of interest, N-R forms, and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
